    "Miniaturized, High Flow, Low Dead Volume Pre-Concentrator for Trace Contaminants
    in Water under Microgravity Conditions Project",nt"tracking_summary": {ntt"total":
    3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:18:31.578011",nt"name": "miniaturized-high-flow-low-dead-volume-pre-concentrator-for-trace-contaminants-in-water-un",nt"isopen":
    true,nt"url": null,nt"notes": "Thorleaf Research, Inc. proposes to develop
    a miniaturized high flow, low dead-volume pre-concentrator for monitoring trace
    levels of contaminants in water under microgravity conditions. Our innovative design
    for the pre-concentrator assembly combines high water sampling flow rates with low
    dead volume in the device, enhancing pre-concentration while avoidingrncavitation
    effects. This will help meet monitoring needs for NASA's Spacecraft Water Exposure
    Guidelines (SWEGs). Although miniaturized mass spectrometers and other detectors
    are under development by NASA, the potential of such instrumentation to meet NASA
    needs will not be realized without complementary developments in the technology
    for collecting andrnpreparing samples for in situ measurements. Based on our analysis,
    we project that it will be possible to develop a miniaturized water pre-concentrator
    module with a mass on the order of 0.5 kg and an average power consumption of &lt;1
    watt, depending on the configuration selected. Ourrngoal in the proposed SBIR Phase
    I effort is to demonstrate feasibility for such a system and to develop a detailed
    design for fabricating and demonstrating prototypes in Phase II.",nt"license_title":
